# Fungsi untuk mengambil komentar dari video
def get_video_comments(video_id, max_comments):
    comments = []
    next_page_token = None

    while len(comments) < max_comments:
        request = youtube.commentThreads().list(
            part='snippet',
            videoId=video_id,
            maxResults=100,
            pageToken=next_page_token,
            textFormat='plainText'
        )
        response = request.execute()

        for item in response['items']:
            if len(comments) < max_comments:
                comment = item['snippet']['topLevelComment']['snippet']
                comments.append({
                    'author': comment['authorDisplayName'],
                    'comment': comment['textDisplay'],
                    'like_count': comment['likeCount'],
                    'published_at': comment['publishedAt']
                })

        next_page_token = response.get('nextPageToken')
        if not next_page_token:
            break

    return comments

# Fungsi untuk menyimpan komentar ke file CSV
def save_comments_to_csv(filename, comments):
    keys = comments[0].keys()
    with open(filename, 'w', newline='', encoding='utf-8') as f:
        dict_writer = csv.DictWriter(f, fieldnames=keys)
        dict_writer.writeheader()
        dict_writer.writerows(comments)

# Fungsi utama untuk mengambil komentar dari beberapa video (Di sini hanya 1 video)
def scrape_comments_from_videos(video_ids, total_comments, output_filename):
    all_comments = []

    for video_id in video_ids:
        comments_per_video = int(total_comments / len(video_ids))
        video_comments = get_video_comments(video_id, comments_per_video)
        all_comments.extend(video_comments)

    # Simpan hasilnya ke file CSV
    save_comments_to_csv(output_filename, all_comments)
    return all_comments

