"""# Preprocessing"""

import pandas as pd
import re
import string
import nltk
from nltk.corpus import stopwords
from wordcloud import WordCloud
import matplotlib.pyplot as plt

# Download stopwords
nltk.download('stopwords')
nltk.download('punkt')

# Load data
data = pd.read_csv("10 Miliar Dari Warga Untuk Warga di Sumatera.csv")

# Ambil kolom comment saja
df = pd.DataFrame(data[['comment']])

# --- PROSES HAPUS DATA DUPLIKAT ---
df.drop_duplicates(subset="comment", keep="first", inplace=True)

# --- Handle NaN values by filling with empty strings ---
df['comment'] = df['comment'].fillna('')

# --- PROSES CLEANING ---
def remove_html(text):
    return re.sub(r'<.*?>', '', text)

def remove_url(text):
    return re.sub(r'http\S+', '', text)

def remove_emoji(text):
    # Menghapus karakter non-ascii (termasuk emoji)
    return text.encode('ascii', 'ignore').decode('ascii')

def remove_symbols(text):
    return re.sub(r'[^a-zA-Z0-9\s]', '', text)

def remove_numbers(text):
    return re.sub(r'\d+', '', text)

def remove_usernames(text):
    return re.sub(r'@[A-Za-z0-9]+', '', text)

# Terapkan Cleaning
df['cleaning'] = df['comment'].apply(remove_url)
df['cleaning'] = df['cleaning'].apply(remove_html)
df['cleaning'] = df['cleaning'].apply(remove_emoji)
df['cleaning'] = df['cleaning'].apply(remove_symbols)
df['cleaning'] = df['cleaning'].apply(remove_numbers)
df['cleaning'] = df['cleaning'].apply(remove_usernames)

# --- CASE FOLDING ---
def case_folding(text):
    return text.lower()

df['case_folding'] = df['cleaning'].apply(case_folding)

# --- NORMALISASI KATA ---
# The original URL for kamus_kata_baku is broken (HTTP Error 404).
# For demonstration purposes, a small dictionary is provided here.
# For comprehensive normalization, you may need to find an updated source or create your own.
kamus_dict = {
    'yg': 'yang',
    'tdk': 'tidak',
    'jd': 'jadi',
    'g': 'tidak',
    'aja': 'saja',
    'bgt': 'banget',
    'udh': 'sudah',
    'jg': 'juga',
    'sy': 'saya',
    'org': 'orang'
}

def normalisasi_kata(text):
    return ' '.join([kamus_dict[word] if word in kamus_dict else word for word in text.split()])

# Tambahan kamus manual (opsional) - this will update the sample kamus_dict
kamus_tambahan = {
    'plg': 'pulang',
    'bg':'banget',
    'bngt':'banget'
}
kamus_dict.update(kamus_tambahan)

df['normalisasi'] = df['case_folding'].apply(normalisasi_kata)

# --- TOKENIZATION ---
def tokenize(text):
    return text.split()

df['tokenize'] = df['normalisasi'].apply(tokenize)

# --- STOPWORD REMOVAL ---
stop_words = set(stopwords.words('indonesian'))

# Tambahan stopwords manual
stopwords_add = {'ya', 'tok', 'deh', 'woy', 'sih', 'bg', 'not', 'nih', 'cs', 'amp', 'lu', 'gue', 'gw'}
stop_words.update(stopwords_add)

def remove_stopwords(tokens):
    return [word for word in tokens if word not in stop_words]

# Terapkan stopword removal dan gabungkan kembali jadi kalimat
df['stopword_removal'] = df['tokenize'].apply(remove_stopwords).apply(lambda x: ' '.join(x))

# Hapus data kosong setelah preprocessing
df['stopword_removal'].replace('', float('NaN'), inplace=True)
df.dropna(subset=['stopword_removal'], inplace=True)

# Simpan hasil preprocessing
df.to_csv("hasil_preprocessing.csv", index=False)
